(7, 'Frontend Web Development', '<p>This course is designed for beginners with little or no experience in web development. You’ll start with the basics—<strong data-start=\"376\" data-end=\"384\">HTML</strong>, <strong data-start=\"386\" data-end=\"393\">CSS</strong>, and <strong data-start=\"399\" data-end=\"413\">JavaScript</strong>—and gradually build your skills toward mastering <strong data-start=\"463\" data-end=\"472\">React</strong>, the powerful library used to create modern, dynamic websites and web apps.</p>', 4, 'active', '2025-04-19 11:39:04', 5000.00, NULL, 8, 'Beginner', 'Certification of Completion ', 5, NULL, '', 'active', 'paid', 'self-paced', 1, '{\"Week 1\":\"\"}', 0, '68039871bce3b_OIP (1).jpg', NULL, 0),
(8, 'Backend Web Development', 'This course equips learners with practical skills to build powerful and scalable backend applications using <strong data-start=\"212\" data-end=\"223\">Node.js</strong> and <strong data-start=\"228\" data-end=\"239\">MongoDB</strong>. Students will learn to create RESTful APIs, manage databases, handle user authentication, and structure full-stack applications. By the end of the course, learners will be able to develop server-side applications and connect them seamlessly with frontend interfaces, preparing them for real-world backend development roles.', 4, 'active', '2025-04-19 13:03:29', 0.00, NULL, 8, 'Beginner', 'Certification of Completion ', 5, NULL, '', 'active', 'free', 'self-paced', 1, '{\"Week 1\":\"\"}', 0, '6803a23ea5d63_3909236.webp', NULL, 0),
(9, 'Full Stack Web Development ', '<p data-start=\"219\" data-end=\"506\" class=\"\">This course is designed to equip learners with end-to-end skills required to build modern, dynamic, and responsive full-stack web applications. Using the <strong data-start=\"373\" data-end=\"387\">MERN stack</strong> — <strong data-start=\"390\" data-end=\"401\">MongoDB</strong>, <strong data-start=\"403\" data-end=\"417\">Express.js</strong>, <strong data-start=\"419\" data-end=\"428\">React</strong>, and <strong data-start=\"434\" data-end=\"445\">Node.js</strong> — students will learn both frontend and backend development.</p>\r\n<p data-start=\"508\" data-end=\"854\" class=\"\">On the <strong data-start=\"515\" data-end=\"527\">frontend</strong>, learners start with the fundamentals of <strong data-start=\"569\" data-end=\"577\">HTML</strong>, <strong data-start=\"579\" data-end=\"586\">CSS</strong>, and <strong data-start=\"592\" data-end=\"606\">JavaScript</strong>, then dive into <strong data-start=\"623\" data-end=\"632\">React</strong> for building interactive user interfaces. On the <strong data-start=\"682\" data-end=\"693\">backend</strong>, they’ll use <strong data-start=\"707\" data-end=\"718\">Node.js</strong> and <strong data-start=\"723\" data-end=\"734\">Express</strong> to build RESTful APIs, connect with <strong data-start=\"771\" data-end=\"782\">MongoDB</strong> for database management, and handle user authentication and deployment.</p>\r\n<p data-start=\"856\" data-end=\"1018\" class=\"\">By the end of the course, students will have built real-world projects, mastered the full development cycle, and be ready to take on full stack development roles.</p>', 4, 'active', '2025-04-19 13:12:23', 9999.99, NULL, 16, 'Beginner', 'Certification of Completion ', 5, NULL, '', 'active', 'paid', 'self-paced', 1, '{\"Week 1\":\"Week 1: Introduction to the Web & HTML\"}', 0, '6803a3e7c9fdf_OIP (4).jpg', NULL, 0);

